      <img src={logo} alt="vintage tech logo" className="logo" />
      <nav>

      </nav>
     <div>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/products">Products</Link>
            </li>
            </div>
    </header>
  );
}
